import React from 'react';
import { useNavigate } from 'react-router-dom';

function StudentDashboard() {
  const navigate = useNavigate();

  const handleLogout = () => {
    // Clear user session or token
    localStorage.removeItem('authToken'); // Example: removing a token from local storage
    // You can also reset any relevant user state if using a global state management solution

    // Redirect to the login page
    navigate('/');
  };

  return (
    <div className="student-dashboard">
      <h1>Student Dashboard</h1>
      <p>Welcome, Student! Here you can view your enrolled courses and track your progress.</p>
      <ul>
        <li><a href="/enrolled-courses">Enrolled Courses</a></li>
        <li><a href="/course-materials">Course Materials</a></li>
        <li><a href="/exams">Exams</a></li>
        <li><a href="/certificates">Certificates</a></li>
      </ul>
      <button onClick={handleLogout} className="logout-button">
        Logout
      </button>
    </div>
  );
}

export default StudentDashboard;
